import request from '@/utils/request'; // 查询列表

export function getDTOs(query) {
  return request({
    url: '/ems/setWorkshopEnergy',
    method: 'get',
    params: query
  });
} // 创建

export function postDTO(data) {
  return request({
    url: '/ems/setWorkshopEnergy',
    method: 'post',
    data: data
  });
} // 查询单个

export function getDTO(rowId) {
  return request({
    url: "/ems/setWorkshopEnergy/".concat(rowId),
    method: 'get'
  });
} // 更新

export function patchDTO(rowId, data) {
  return request({
    url: "/ems/setWorkshopEnergy/".concat(rowId),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteDTO(data) {
  return request({
    url: "/ems/setWorkshopEnergy",
    method: 'delete',
    data: data
  });
} // 查询

export function queryUnits(factoryCode) {
  var query = {
    factoryCode: factoryCode
  };
  return request({
    url: "/ems/setWorkshopEnergy/factoryshop",
    method: 'get',
    params: query
  });
}
